using Domain.Models;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using Shared;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Infrastructure.EntityConfigs
{
    public class IngredientConfig : IEntityTypeConfiguration<Ingredients>
    {
        public void Configure(EntityTypeBuilder<Ingredients> builder)
        {
            builder.HasKey(i => i.Id);

            builder.HasData(
            new Ingredients { Id = 1, Name = "Vegetables", image = "" },
            new Ingredients { Id = 2, Name = "Chicken", image = "" },
            new Ingredients { Id = 3, Name = "Milk", image = "" },
            new Ingredients { Id = 4, Name = "Fish", image = "" },
            new Ingredients { Id = 5, Name = "Cheese", image = "" },
            new Ingredients { Id = 6, Name = "sugar", image = "" },
            new Ingredients { Id = 7, Name = "rice", image = "" },
            new Ingredients { Id = 8, Name = "wheat", image = "" }
                );
        }
    }

}
